import React from 'react'
import "./Feed.css";
import TweetBox from './TweetBox';
import Post from './Post';


function Feed() {
  return (
    <div className="feed">
        <div className="feedHeader">
            <h2>Home</h2>
        </div>

        <TweetBox />
        <Post User/>

    </div>
  )
}

export default Feed
